import React from 'react'
import { casas } from '../data'

function marcar(id) {
  console.log(id)
}

export default function Board() {
  return (
    <div id="jogo">
      {casas.map((casa, index) => {
        return (<div id={casa.id} onclick={marcar(casa.id)} key={index}></div>)
      })}
    </div>
  )
}
